        flat.tealium_event = flat.page_type || flat.pageType || &quot;other-view&quot;;
        utag.DB(&quot;Listener - View / &quot; + flat.tealium_event, flat);
        utag.view(flat);
    } else if (model.event === &quot;loginstatus&quot;) {
        flat.tealium_event = flat.event;
        utag.DB(&quot;Listener - Link / &quot; + flat.tealium_event, flat);
