// categories and number
// Analyseanbieter  - 1
// Affiliate        - 2
// Display Ad       - 3
// Suche            - 4
// Email            - 5
// Personalisierung - 6
// Social           - 7
// Big Data         - 8
// Sonstiges        - 9
// Cookie Match     - 10
// CDP              - 11
// Mobilanwendung   - 12
// Engagement       - 13
// berwachung      - 14
// CRM              - 15
var consent_map = {
    &quot;essential&quot;: [
        10, 12
    ],
    &quot;functional&quot;: [
        1, 4, 8, 13, 14
    ],
    &quot;marketing&quot;: [
        2, 3, 5, 6, 7, 9, 11, 15
    ]
};
var backendCookieName = 'cookie_consent';
// all template id with all values will be forwarded with the cookie_consent cookie
var cookiesForBackend = {
    // Legend: templateId: shortName // Real name in comment
    &quot;BJz7qNsdj-7&quot;: &quot;yt&quot;, // Youtube
    &quot;HkocEodjb7&quot;: &quot;ga&quot;, // Google Analytics
    &quot;7mr00cd_R&quot;: &quot;at&quot;, // Adition
    &quot;nWlCqTinS&quot;: &quot;Prtn&quot;, // partner
    &quot;qfLH_JebG&quot;: &quot;SubP&quot;, // sub partner
    &quot;irFvwDSIZ&quot;: &quot;Cmpg&quot;, // campaign
    &quot;xtYvv-vyb&quot;: &quot;pt&quot;, // PartnerTracking
    &quot;KOxQzFMgd&quot;: &quot;SfoB&quot; // Banking - Welcome back calculator overlay
};

var cookieConsentLayerName = 'cmapi_cookie_privacy';
var allowEverthingCookieValue = 'permit 3';
var allowMinimumCookieValue = 'permit 1 required'; 
// cookie value to format {&quot;nameOfAllowedCategorie&quot;: true, &quot;nameOfDeniedCategorie&quot;: false.....}
var oldValuesToCategorie = {
    &quot;permit 3&quot;: {
        &quot;essential&quot;: true,
        &quot;functional&quot;: true,
        &quot;marketing&quot;: true
    },
    &quot;permit 2 functional&quot;: {
        &quot;essential&quot;: true,
        &quot;functional&quot;: true,
        &quot;marketing&quot;: false
    },
    &quot;permit 1 required&quot;: {
        &quot;essential&quot;: true,
        &quot;functional&quot;: false,
        &quot;marketing&quot;: false
    }
};

function getCookieDomain() {
    var a = &quot;&quot; + location.hostname;
    var b = a.split(&quot;.&quot;);
    var c = (/\.co\.|\.com\.|\.org\.|\.edu\.|\.net\.|\.asn\.|\...\.jp$/.test(a)) ? 3 : 2;
    return b.splice(b.length - c, c).join(&quot;.&quot;);
}
var cookieDomain = getCookieDomain();

// return format {&quot;nameOfAllowedCategorie&quot;: true, &quot;nameOfDeniedCategorie&quot;: false.....}
function getAllowedCategoriesFromUserCentricsConsents(consents) {
    var allowedCategories = {};
    var consentLength = consents.length;
    for (var i = 0; i &lt; consentLength; i++) {
        var item = consents[i];
        if (item.isDeactivated === true) {
            continue;
        }
        var category = item.categorySlug || item.defaultCategorySlug || &quot;&quot;;
        if (typeof allowedCategories[category] !== 'undefined') {
            allowedCategories[category] &amp;= item.consentStatus;
        }
        else {
            allowedCategories[category] = item.consentStatus;
        }
        // mapping to boolean
        allowedCategories[category] = !!allowedCategories[category];
    }

    // merge default permissions with the usercentrics values
    allowedCategories = Object.assign(oldValuesToCategorie[allowMinimumCookieValue], allowedCategories);

    return allowedCategories;
}


// return format {&quot;nameOfAllowedCategorie&quot;: true, &quot;nameOfDeniedCategorie&quot;: false.....}
function getAllowedCategoriesFromUserCentricsCategories(categories) {
    var allowedCategories = categories.reduce(function(accu, ele) {
        accu[ele.categorySlug] = ele.isEssential || ele.status || false;
        
        return accu;
    }, {})

    // merge default permissions with the usercentrics values
    allowedCategories = Object.assign(oldValuesToCategorie[allowMinimumCookieValue], allowedCategories);
    
    return allowedCategories;
}

// 
function writeBackendCookiesByConsents(consents) {
    var backendCookieList = {};
    var consentLength = consents.length;
    for (var i = 0; i &lt; consentLength; i++) {
        var item = consents[i];
        if (typeof cookiesForBackend[item.templateId] !== &quot;undefined&quot;) {
            backendCookieList[cookiesForBackend[item.templateId]] = !!item.consentStatus ? 1 : 0;
        }
    }
    document.cookie = backendCookieName + &quot;=&quot; + JSON.stringify(backendCookieList) + &quot;; expires=&quot; 
        + new Date((new Date()).getTime() + (1000 * 60 * 60 * 24 * 365)) + &quot;; path=/; domain=&quot; + cookieDomain + &quot;;&quot;;
}

// allowedCategories format {&quot;nameOfAllowedCategorie&quot;: true, &quot;nameOfDeniedCategorie&quot;: false.....}
function setGDPRCategories(allowedCategories) {
    var consent = {};
    for (var cookieCategory in allowedCategories) {
        var tealiumCategories = consent_map[cookieCategory];
        if (Array.isArray(tealiumCategories)) {
            var tealiumCategoriesLength = tealiumCategories.length;
            for (var i = 0; i &lt; tealiumCategoriesLength; i++) {
                var tealiumCat = tealiumCategories[i];
                consent[tealiumCat] = allowedCategories[cookieCategory] === true ? 1 : 0;
            }
        }
    }
    utag.gdpr.setPreferencesValues(consent);
}

function getAllowedCategoriesByCookieValue(cookieValue) {
    var allowedCategories = oldValuesToCategorie[cookieValue];
    if (typeof allowedCategories !== 'object') {
        oldValuesToCategorie[allowEverthingCookieValue];
    }
    return allowedCategories;
}


var cookieObject = getCookieObject();

// #### handle usercentrics and cookie consents layer ####

// usercentrics is available
if (window.usercentrics &amp;&amp; window.usercentrics.appLoaded) { 
    // trigger on layer change
    window.addEventListener(&quot;ucEvents&quot;,
        debounce(function() {
            var allowedCategories = getAllowedCategoriesFromUserCentricsCategories(window.usercentrics.categories || []);
            writeBackendCookiesByConsents(window.usercentrics.getConsents() || [])
            setGDPRCategories(allowedCategories);
        }, 100)
    );
    // process the inital setted values
    var allowedCategories = getAllowedCategoriesFromUserCentricsCategories(window.usercentrics.categories || []);
    writeBackendCookiesByConsents(window.usercentrics.getConsents() || [])
    setGDPRCategories(allowedCategories);
}
// cookie is already setted
else if (typeof cookieObject[cookieConsentLayerName] === 'string') {
    // use cookie value
    setGDPRCategories(getAllowedCategoriesByCookieValue(cookieObject[cookieConsentLayerName]));
// cookie is not set
} else {
    // allow only essential
    setGDPRCategories(oldValuesToCategorie[allowMinimumCookieValue]);
}

