// logging function - we need because the internal log function of tealium is not yet ready
var logger = function(message) {
    var cookieValue = document.cookie + '';
    if (cookieValue.indexOf('utagdb=true') === -1) {
        return;
    }
    message = &quot;\n&quot; + message + &quot;\n&quot;;
    var formattedArr = [];
    formattedArr.push(&quot;****************&quot;);

    var messageArr = message.split(&quot;\n&quot;);
    var messageLen = messageArr.length;
    for (i = 0; i &lt; messageLen; i++) {
        formattedArr.push(&quot;*  &quot; + messageArr[i]);
    }
    formattedArr.push(&quot;****************&quot;);
    console.log(formattedArr.join(&quot;\n&quot;));
};

// expose globally
window.tealiumConsentLogger = logger;

// function for creating object copy
var getShallowCopy = function(sourceObject) {
    var copy = {}
    var keys = Object.keys(sourceObject);
    var keyLen = keys.length;
    for (i = 0; i &lt; keyLen; i++) {
        copy[keys[i]] = sourceObject[keys[i]]
    }
    return copy;
};

// stops tealium by negating the condition for the following process and setting the tealium internal flags
var stopTiq = function () {
    // logger(&quot;stopTiq function fired&quot;)
    window.utag_cfg_ovrd_original = getShallowCopy(window.utag_cfg_ovrd || {});
    window.utag_cfg_ovrd = {};
    window.utag_cfg_ovrd.noload = true;

    utag_condload = true; // break the processing
};

// gets the url of the first utag.js script, is used to initialize a new script tag, which restarts the tealium process
var getUtagScriptUrl = function() {
    var tag = document.querySelector('script[src*=&quot;utag.js&quot;]');
    if (tag &amp;&amp; tag.src) {
        return tag.src
    }

    return &quot;&quot;; // failure case
};

// starts tealium after it is stopped by resetting the internal flags, setting the condition for
// the following processes again and putting a new script tag into the dom, which restarts the tealium process
var reloadTiq = function(callbackId) {
    window.utag_data = window.utag_data || {};
    logger(&quot;reloadTiq function fired&quot;);

    // reload (to refire TiQ), but let it pull from the cache
    (function(a,b,c,d){
        logger(&quot;Adding TiQ in response to callbackId &quot; + callbackId);
        window.utag_cfg_ovrd = window.utag_cfg_ovrd_original || {}
        window.utag = undefined;

        a=getUtagScriptUrl();
        b=document;c='script';d=b.createElement(c);d.src=a;d.type='text/java'+c;d.async=true;
        d.setAttribute(&quot;data-tealium-cmp-callback-id&quot;, callbackId);
        a=b.getElementsByTagName(c)[0];a.parentNode.insertBefore(d,a);
    })();

    window.utag_cfg_ovrd = {};
    window.utag_cfg_ovrd.noload = false;

    utag_condload = false; // continue with the workflow
};

// function to find out if the customer has already confirmed the layer
var isFirstUserInteractionDone = function () {
    try {
        var lsEntry = window.localStorage.getItem(&quot;usercentrics&quot;);
        if (lsEntry) {
            var ucData = JSON.parse(lsEntry);
            if (ucData &amp;&amp; ucData.firstUserInteraction) {
                return !!(ucData.firstUserInteraction.stateSaved);
            }
        }
        return false;
    } catch (e) {
        console.error(e);
        return true;
    }
}

// function to wait for user interaction with the layers
var waitForFirstUserInteractionIsDone = function (id) {
    var layerState = isFirstUserInteractionDone();
    if (layerState === true) {
        reloadTiq(id);
    } else {
        var listerName = &quot;ucEvents&quot;;
        var waitForLayerSave = function (e) {
            if (e &amp;&amp; e.event === &quot;consents_changed_finished&quot;) {
                window.removeEventListener(listerName, waitForLayerSave);
                reloadTiq(id);
            }
        };
        window.addEventListener(listerName, waitForLayerSave);
    }
}


// examination of the conditions
var layerState = isFirstUserInteractionDone();
if (typeof window.usercentrics === &quot;undefined&quot; || typeof window.usercentrics.appLoaded === &quot;undefined&quot; ||
    (true === window.usercentrics.isInitialized &amp;&amp; layerState === true)
) {
    logger(&quot;All dependencies are initalized, tealium can start normally.&quot;)
    utag_condload = false; // continue with the workflow
} else {
    // Initial conditions do not fit
    var id = Math.random() * 1e18;
    logger(&quot;Dependencies are not here&quot;);
    stopTiq();
    window.utag_data = window.utag_data || {};

    // usercentrics is not initalized
    if (true !== window.usercentrics.isInitialized) {
        if (typeof window.usercentrics_wait_registered === &quot;undefined&quot;) {
            var oldFn = window.usercentrics.onViewInit;
            window.usercentrics.onViewInit = function () {
                if (oldFn) {
                    oldFn();
                }

                logger(&quot;callback function fired, request id: &quot; + id);
                waitForFirstUserInteractionIsDone(id)
            };
            window.usercentrics_wait_registered = true
        }
    } else {
    // user interaction is not finished
        waitForFirstUserInteractionIsDone(id);
    }
}

