.privacy_prompt { 
     position: absolute; 
     width: 600px; 
     top: 100px; 
     left: 50%; 
     margin-left: -300px; 
     text-align: left; 
     border: 1px solid #CCC; 
     border-radius: 4px; 
     background-color: #FFF; 
     color: #444; 
     font-size: 14px; 
     z-index: 1000; 
     word-break: break-word; 
  } 

 .privacy_prompt a { 
     text-decoration: none; 
     color: #0077bf; 
 } 

